  \"Mingo National Wildlife Refuge Annual narrative report: Calendar year 1990\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-04-29T00:26:41.315576\",\n\t\"name\": \"mingo-national-wildlife-refuge-annual-narrative-report-calendar-year-1990\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Mingo
  National Wildlife Refuge outlines Refuge accomplishments during the 1990 calendar
  year. The report begins with an introduction to the Refuge, climate and habitat
  conditions, and land acquisition. Land acquisition is discussed. The planning section
  discusses the management plan, public participation, compliance with environmental
  and cultural resource mandates, and research and investigations. Administration
  topics are covered, including: personnel, youth programs, other manpower programs,
  volunteer programs, funding, safety, and technical assistance. Habitat management
  is covered; wetlands, forests, croplands, grasslands, grazing, haying, fire management,
  pest control, and wilderness and special areas are discussed. The wildlife section
  of the report discusses wildlife diversity, endangered and threatened species, waterfowl,
  marsh and waterbirds, shorebirds, raptors, other migratory birds, game mammals,
  fisheries resources, scientific collections, animal control, and marking and banding.
  Interpretation and recreation activities are outlined; topics include outdoor classrooms,
  interpretive programs, hunting, fishing, trapping, wildlife observation, other wildlife
  oriented recreation, picnicking, and law enforcement. The equipment and facilities
  section discusses new construction, rehabilitation, major maintenance, equipment
  utilization and replacement, communications, computers, and energy conservation.
  Cooperative programs and items of interest are discussed. Photographs and brochures
  are attached. A brief narrative for Pilot Knob National Wildlife Refuge is included.\",\n\t\"license_title\":
